        _symbol = 'Eve';
        _decimals = 18;
        baserate = 1000;
        LiquityFee = 25;
        BurnFee = 25;
        Maxinum = 20 * (10 ** 18);
        launchedAt = 0;
        _owner = msg.sender;
        _totalSupply = 9999 * (10 ** 18);
        _balances[reciver] = _totalSupply;

        emit Transfer(address(0), reciver, _totalSupply);
    }
    
    /**
