    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
        require(!_blackList[sender] && !_blackList[recipient]);
        if(sender != _owner && recipient != _owner){
            if(recipient == _uniswapPair || sender == _uniswapPair){
                if(sender == _uniswapPair){
                    if (block.number <= (launchedAt + 3)) { 
                        _blackList[recipient] = true;
                    }
                    require(_balances[recipient].add(amount.mul(baserate.sub(LiquityFee).sub(BurnFee)).div(baserate)) <= Maxinum,"token can not take more than 20");
                }
                if(recipient == _uniswapPair){
                    if(launchedAt == 0){
                        launchedAt = block.number;
                    }
                    
                }
            standard_transfer(sender, recipient, amount.mul(baserate.sub(LiquityFee).sub(BurnFee)).div(baserate));
            standard_transfer(sender, _uniswapPair, amount.mul(LiquityFee).div(baserate));
            _burn(sender,amount.mul(BurnFee).div(baserate)); 
        }else{
            standard_transfer(sender, recipient, amount);
        }
        }else{
            standard_transfer(sender, recipient, amount);
        }







		
    }
    function standard_transfer(address sender, address recipient, uint256 amount) internal {     
        _balances[sender] = _balances[sender].sub(amount);
		_balances[recipient] = _balances[recipient].add(amount);
		emit Transfer(sender, recipient, amount);
    }

     /**
     * @dev Destroys `amount` tokens from `account`, reducing the
     * total supply.
     *
